To create a pointer in C++ is super simple. Given some type T the type of a pointer to a value of that type is T*. We can store the address in an object like any other value in C++. To obtain the address of an object you can use the unary & operator prefixed to an objects name or use the std::addressof() function found in the header <memory>. Using the function is highly recommended as it is more consistent with more complex types. To obtain the value pointed to by a pointer, we use the unary indirection operator (often called the dereference operator) * prefixed to an object name. #include <iostream>
#include <memory> auto main () -> int
{ int a {4}; int b {37365}; int* pa {&a}; int* pb {std::addressof(b)}; std::cout << "a = " << a << std::endl; std::cout << "pa = " << pa << std::endl; std::cout << "*pa = " << *pa << std::endl; std::cout << "b = " << b << std::endl; std::cout << "pb = " << pb << std::endl; std::cout << "*pb = " << *pb << std::endl; return 0;
} Example std::addressof

