Because pointers are an independent type, they are able to have to have const (among other) qualifications however, the ordering of the qualifications can matter. const T* - Pointer to constant data. The data cannot be changed but the pointer can point to a new location. (T const* is identical) T* const - Constant pointer to data. The data can be modified but the pointer can only point to the original value (address). #include <iostream>
#include <memory> auto main () -> int
{ int a {4}; int b {37365}; const int* pa {&a}; int* const pb {std::addressof(b)}; std::cout << "*pa = " << *pa << std::endl; *pa += 3; ///< Fails, comment out to run pa = std::addressof(b); std::cout << "*pa = " << *pa << std::endl; std::cout << "*pb = " << *pb << std::endl; *pb += 3; pb = std::addressof(a); ///< Fails, comment out to run std::cout << "*pb = " << *pb << std::endl; return 0;
} Example

