Because of C++'s static type system, the type of a pointer must be declared however you can circumvent the type system using void. A pointer can be a void*, meaning that the type it points to is unbound. When you need to use the type you can then use static_cast<>() to create the type that you need. This is actually how C's malloc() function works. It returns a void* and it is up to the user to cast it to the desired type. #include <iostream>
#include <memory> auto main () -> int
{ int a {4}; void* pa {std::addressof(a)}; std::cout << "*pa = " << *static_cast<int*>(pa) << std::endl; std::cout << "*pa = " << *pa << std::endl; ///< This will fail, comment out to run return 0;
} Example C's malloc()

