Because pointers are just numbers (addresses) we can add and subtract from then as if they were integral types. We can use the increment, decrement, addition, subtraction and subscript (index) operators on pointers (+, -, ++, -- and [] respectively). This can used to create and access a sequence or memory. This is how a string literal ("") works in C++, they are really sequence of char that exist in your program statically. C++ then decays them into the type const char* so functions can refer to them such as std::cout <<. However, pointer arithmetic is very error prone. and leads to low readability and maintainability, but is useful to understand and for highly controlled manipulation of data. #include <iostream> auto main () -> int
{ auto greeting {"Hello!"}; const char* response {"Hi!!!"}; for (auto i {0}; i < 7; ++i) std::cout << greeting[i]; std::cout << std::endl; for (auto i {0}; i < 6; ++i) std::cout << *(response + i); std::cout << std::endl; /// These will have the same type std::cout << "typeid(greeting).name() = " << typeid(greeting).name() << std::endl; std::cout << "typeid(response).name() = " << typeid(response).name() << std::endl; for (auto i {0}; i < 6; ++i) std::cout << *(response++) << std::endl; std::cout << "response = " << response << std::endl; ///< This now points to whatever is stored after `response`. return 0;
} Example

