In C++, any assignment and initialisation is is copy by default even when passed to functions. This can be really costly for objects that have a large amount of data stored in them. Pointers make it cheap to pass the data around as you now just have to pass a pointer to it instead of all the data. However, there is a catch to pointers. Pointers can point to nothing, this nothing value is actually the literal nullptr we saw in week 0. And you cannot dereference a pointer to nullptr as nullptr is nothing. This can be really dangerous as this is considered UB which may work, may not compile, may crash the entire program or do something entirely unexpected. #include <iostream> auto main () -> int
{ int* p {nullptr}; std::cout << "p = " << p << std::endl; ///< p = 0 /// Compiles (on Godbolt) but throws a runtime error (see return of program is not zero) std::cout << "*p = " << *p << std::endl; return 0;
} Example

