It is also possible in C++ to have a pointer to a pointer. This mostly a feature inherited from C and remains in for C++ to interoperate with C and for completeness. Pointers to pointers may seem daunting but are straight forward if you apply the concept of a pointer again. The pointer-to-pointer object points to the address of the pointer object that holds the address of some other object. Pointer-to-pointers have the type T** and can be dereferenced to the their value, ie. the address the nested pointer points to or again to get the bottom value. #include <iostream>
#include <memory> auto main () -> int
{ int a {6}; int* p {std::addressof(a)}; int** pp {std::addressof(p)}; std::cout << "pp = " << pp << std::endl; std::cout << "*pp = " << *pp << std::endl; std::cout << "**pp = " << **pp << std::endl; return 0;
} Example Note: auto is able to deduce the type if the right-hand-side is a rvalue however, the const qualifications cannot be specified. ie. T* -> auto and T** -> auto.

