Slices are useful for packing contiguous data into a single object but because of the implicit nature of decaying into pointers they can be error prone. This is where C++'s array type come in. std::array comes in. This is a complete array type that store both its data and size. Like slices, std::array must know its type and size at compile time and the type must be the same throughout the array. Because std::array is a complete object you can use reference semantics on it in an intuitive way. It is highly recommended to use std::array instead of slices everywhere you can. #include <iostream>
#include <array> void print(std::array<int, 6> arr)
{ std::cout << "[ "; for (auto i {0}; i < arr.size(); ++i) std::cout << arr[i] << ", "; std::cout << "]" << std::endl;
