std::unique_ptr is a pointer to a uniquely owned resource. It cannot be copied, only moved. When a std::unique_ptr goes out of scope it automatically deletes the allocated resource. Because std::unique_ptr is a complete object you can pass a reference of a std::unique_ptr and modify the underlying value like a pointer. It also offers a safer std::unique_ptr::get() method that returns nullptr if the std::unique_ptr points to nothing. #include <iostream>
#include <memory> void print(std::unique_ptr<int>& ptr)
{ std::cout << ptr << std::endl; std::cout << *ptr << std::endl;
} void add_magic(std::unique_ptr<int>& ptr)
{ *ptr += 42; } auto main () -> int
{ std::unique_ptr<int> p1(new int(6)); auto p2 = std::make_unique<int>(7); auto p3 = std::unique_ptr<int>{nullptr}; print(p1); print(p2); add_magic(p1); // add_magic(p3); ///< Would fail print(p1); // print(p3); ////< Would fails return 0;
} Example std::unique_ptr

