Sometimes it useful to have multiple pointers refer to the same dynamic memory resource. However, one issue of this is there is know way to know if the memory resource is still needed but another pointer meaning a memory resource can be released accidently leaving all other pointers to the now deleted resource a dangling pointer. This is where std::shared_ptr comes in handy. This pointer will maintain a count or how many pointers refer to it. Only when this count reaches zero, indicating no more pointers are using the resource will the resource get deleted. This gives the behavior of many garbage collected languages without the massive overhead of a global gabage collecting program. #include <iostream>
#include <memory> void print(std::shared_ptr<int> ptr)
{ std::cout << "ptr = " << ptr << std::endl; std::cout << "*ptr = " << *ptr << std::endl; std::cout << "ptr.use_count() = " << ptr.use_count() << std::endl;
} void add_magic(std::shared_ptr<int>& ptr)
{ *ptr += 42; } auto main () -> int
{ auto p = std::make_shared<int>(7); std::cout << "p.use_count() = " << p.use_count() << std::endl; print(p); add_magic(p); return 0;
} Example std::shared_ptr

