Sometimes it is useful to observe an existing resource that is managed by std::shared_ptr and only assume temporary ownership if the object still exists. This is where std::weak_ptr is used. It is constructed from an existing std::shared_ptr and observes the memory resource and is able to be converted to a std::shared_ptr when it needs to access the resource. This is useful for breaking reference cycles of std::shared_ptr's and extend the lifetime of a memory resource to the scope of a std::weak_ptr. It is also able to check if the resource has been deleted already. #include <iostream>
#include <memory> void print(std::weak_ptr<int> ptr)
{ std::cout << "ptr.use_count() = " << ptr.use_count() << std::endl; if (auto sp = ptr.lock()) { std::cout << "sp.use_count() = " << sp.use_count() << std::endl; std::cout << "sp = " << sp << std::endl; std::cout << "*sp = " << *sp << std::endl; } else std::cout << "ptr is expired" << std::endl;
} auto main () -> int
{ auto p = std::make_shared<int>(7); std::cout << "p.use_count() = " << p.use_count() << std::endl; print(p); return 0;
} Example std::weak_ptr

