Sometimes it is useful to work with the type of an object, not the value. To obtain the type of an object the decltype keyword. This declares the type of the entity or expression passed to the keyword in a function call style. This is useful for deducing the type of an expression once it has been evaluated. #include <type_traits> auto add(int x, float y) -> decltype(x + y)
{ return x + y; } auto main() -> int
{ static_assert(std::is_same_v<decltype(add(9, 0.345)), float>, "Result is not a float"); static_assert(std::is_same_v<decltype(add(9, 0.345)), int>, "Result is not a int"); return 0;
} Example <type_traits> decltype Sometimes though, it is impossible to find the return type of objects method calls as it requires constructing an actual value. To overcome this, C++ has a neat function called std::declval. This is able to construct an rvalue (temporary) in order to access object methods. #include <type_traits> auto main() -> int
{ static_assert(std::is_same_v<decltype(std::declval<int>()), int&&>, "Result is rvalue"); static_assert(std::is_same_v<decltype(std::declval<int>()), int>, "Result is not rvalue"); return 0;
} Example std::declval<T>

