Functions; like variables, have a type. This makes it possible to use functions are variables that can be passed to other functions. But what is the type of a function? In general the type of a function is composed of its return type and the type of its arguments, ie. R(P1, P2, P3, ...). In C functions are passed as function pointers. It is a powerful utility but can be error prone due to the nature of pointers. Instead, C++ has std::function<R(Args...)> which is able to bind to a function to a variable that can be easily passed around to other functions, copied and moved. #include <functional>
#include <iostream> auto print_num(double i) -> void
{ std::cout << i << '\n'; } auto add(int x, float y) -> double
{ return x + y; } auto mult_print(int x, float y, std::function<void(double)> f) -> void
{ f(x * y); } auto main() -> int
{ std::function<void(double)> print_f {print_num}; std::function<double(int, float)> add_f {add}; print_f(add_f(4, 6.6)); mult_print(3, 0.056, print_f); return 0;
} Example std::function<R(Args...)>

