Sometimes functions need to be able to enclose information about the global environment. This requires the use of closures, a local environment that can access the parent environment in which the closure exists in. In C++ this is accomplished with a lambda. Lambdas are anonymous functions that can capture local variables. Anonymous functions are able to be created and passed to other functions without having to exist as a stored function. Lambdas have a unique syntax consisting of three distinct sets of brackets. [] is used to specified the captured variables, () is the same as regular functions indicating the formal parameters of the lambda that are used when the lambda is invoked, and finally {} holds the body of the lambda. The capture parameters can either capture by value or by reference. Value captures simply specify the variable names while reference captures prefix an & to the variable name. You can also elide the names of captures and implicitly capture variables by using them in the body of the lambda and indicate whether all (or some) of the implicit captures are by value or reference using the symbols = or & respectively. #include <functional>
#include <iostream> auto fmult(int x, float y, std::function<void(double)> f) -> void
{ f(x * y); } auto main() -> int
{ /// Use `std::function<R(Args...)>` for lambda type std::function<double(int, float)> add_f = [](int x, float y) -> double { return x + y; }; /// Lambda declared with `auto` auto print_f = [](double i){ std::cout << i << '\n'; }; /// Lambda capture `print_f` by value auto print_mult = [=](int x, float y){ return fmult(x, y, print_f); }; int a {7}; int b {5}; /// Capture `print_mult` and `a` by value and `b` by reference /// Elide names of `mult_print` and `a` with `=` auto print_7mult5 = [=, &b](){ return print_mult(a, b); }; /// Invoke lambdas like functions print_f(add_f(4, 6.6)); fmult(7, 8.9, [](double i){ std::cout << i << '\n'; }); ///< Use lambda as anonymous function, print_mult(7, 8.9); ///< or use captured version print_7mult5(); ///< 35 b = 9; ///< Modify `b` print_7mult5(); ///< 63 return 0;
} Example Lambdas

