Another useful technique when working with functions is a technique known as partial application. This is similar to how closures with lambda work with a few key differences. Partial application allows you to partially apply the certain parameters of a function while leaving other empty to be passed at a later invocation. This is done with with the std::bind function which takes the function and a variable list of arguments that will be bound to the function in their respective order. The returned function can be invoked like any other function and will be invoked as if the bound variables were passed to it. The power of std::bind comes from its ability to accept placeholder values. These values follow the pattern of _N where N is any number starting at 1. Placeholders are passed to std::bind can can be placed anywhere in the variable argument list. When the resulting function is invoked, any arguments passed to it will be passed to the underlying function. The first passed argument from the partially applied function will be passed to all instances of the _1 placeholder and so on. Note: std::bind cannot bind (const) reference arguments functions take. For this, parameters must be wrapped in std::ref or std::cref to bind to references. #include <functional>
#include <iostream> auto fn(int n1, int n2, int n3, const int& n4, int n5)
{ std::cout << n1 << ' ' << n2 << ' ' << n3 << ' ' << n4 << ' ' << n5 << '\n';
} /// Import placeholders
using namespace std::placeholders; auto main() -> int
{ auto f1 = std::bind(fn, 1, _1, 4, _2, 6); auto f2 = std::bind(fn, _1, _1, _1, _1, _1); auto a {47676}; auto f3 = std::bind(fn, _4, _3, _2, std::cref(a), _1); f3(4, 3, 2, 1); ///< 1 2 3 47676 4 f1(4, a); ///< 1 4 4 47676 6 a = 777; f3(11, 10, 9, 8); ///< 8 9 10 777 11 f1(3, a); ///< 1 3 4 777 6 f2(6); ///< 6 6 6 6 6 return 0;
} Example std::bind std::placeholders std::ref & std::cref There is also two new functions that have been added to the standard library. These are std::bind_front (C++20) and std::bind_back (C++23) that allow for efficiently binding parameters to the front or back of a function. These functions do not support the placeholder values like std::bind. #include <functional>
#include <iostream> auto fn(int n1, int n2, int n3, const int& n4, int n5)
{ std::cout << n1 << ' ' << n2 << ' ' << n3 << ' ' << n4 << ' ' << n5 << '\n';
} auto main() -> int
{ auto f = std::bind_front(fn, 1, 2, 3); f(4, 5); ///< 1 2 3 4 5 return 0;
} Example std::bind_front & std::bind_back

