Namespaces create separation of symbols and names in C++. This allows for types, functions and variables to have the same name without causing collisions and ambiguity. We have already been using a namespace throughout this series, this being the std namespace. Namespaces a named scopes whose members can be accessed using the scope resolution operator ::. To create a namespace you use the namespace keyword followed by the namespace name and a new scope. To use a namespace without having to go through scope resolution you can declare a namespaces use by using namespace /* name */. Note: Using :: with no name looks in the global namespace eg. ::a. #include <iostream> namespace A
{ auto f(int n) -> void { std::cout << n << '\n'; }
} auto f(int n) -> void
{ std::cout << "3 + n:(" << n << ") = " << 3 + n << '\n'; } auto main() -> int
{ // using namespace A; ///< Error: overload is ambiguous (redefinition) f(8); A::f(8); return 0;
} Example Namespaces

