Enumerations (enums) are a distinct types whose value is one of a restricted range of named integral constants called enumerators. Enums allow for specify a type that may have a value of one of many possible named values. Enums have an underlying integral type where each enumerator is of the underlying type. Enums allow for the restriction of the possible values a type can hold. The value of the enumerators of an enum have begin at 0 and increment. #include <iostream> enum Colour { Red, Green, Blue}; auto print_colour_name(Colour c) -> void
{ switch (c) { case Red: std::cout << "Red\n"; break; case Green: std::cout << "Green\n"; break; case Blue: std::cout << "Blue\n"; break; default: std::cout << "Not a colour\n"; break; }
} auto main() -> int
{ Colour c1 {Red}; ///< Unscoped Initialisation Colour c2 {Colour::Green}; ///< Scoped Initialisation auto c3 {Colour::Blue}; ///< `auto` type deduction auto c4 {4}; ///< Non `Colour` print_colour_name(c1); print_colour_name(c2); print_colour_name(c3); print_colour_name(static_cast<Colour>(c4)); return 0;
} Example Enumerations

