A concepts is a set of conditions and requirements imposed on a type that is checked at compile time and evaluates as a Boolean. Before C++20, template metaprogramming and SFINAE where used to statically impose constraints on types but they had limitations and were highly verbose. Concepts allow us to define syntactic constraints on a template type and then impose those constraints on other types. Concepts are introduced using a template declaration followed by a concept declaration (similar to a class declaration but replace the keyword class with concept). Concepts can be composed of other concepts using || and && (holding similar semantics to there Boolean equivalents). It is difficult to create meaningful concepts as one, they are very new to both C++ but also programming in general, instead try and use the concepts defined by the standard library; from the <concepts> header, first and impose them on a case by case basis using the techniques we are going to learn below. #include <concepts>
#include <iomanip>
#include <iostream>
#include <string>
#include <utility> /// Concept defining a type that can be hashed using `std::hash`
template<typename H>
concept Hashable = requires (H a)
{ { std::hash<H>{}(a) } -> std::convertible_to<std::size_t>;
}; struct NotHashable {}; using namespace std::literals; auto main() -> int
{ std::cout << std::boolalpha; std::cout << "Is Hashable<int>: " << Hashable<int> << " : std::hash<int>{}(69) = " << std::hash<int>{}(69) << std::endl; std::cout << "Is Hashable<float>: " << Hashable<float> << " : std::hash<float>{}(4.5756f) = " << std::hash<float>{}(4.5756f) << std::endl; std::cout << "Is Hashable<double>: " << Hashable<double> << " : std::hash<double>{}(-0.0036565764) = " << std::hash<double>{}(-0.0036565764) << std::endl; std::cout << "Is Hashable<std::string>: " << Hashable<std::string> << " : std::hash<std::string>{}() = " << std::hash<std::string>{}(""s) << std::endl; std::cout << "Is Hashable<NotHashable>: " << Hashable<NotHashable> << std::endl; return 0;
} Example <concepts> Constraints and concepts

