There are four functions involved in manipulating an object of iterator kind. These are used to move an iterator between elements. std::next - Obtains the next iterator from the passed iterator. Can be passed an integral n to obtain the nth next iterator. If n is negative, the iterator must satisfy Bidirectional Iterator . std::prev- Obtains the previous iterator from the pass iterator. Can be passed an integral to obtain the nth previous iterator. The iterator must satisfy the requirements of a Bidirectional Iterator . std::distance - Obtains the number of increments required by the first iterator to reach the second iterator. std::advance - Advances the passed iterator by n increments. If n is negative, the iterator must satisfy Bidirectional Iterator . #include <array>
#include <iostream>
#include <iterator> auto main() -> int
{ auto a = std::to_array<int>({1, 3, 4, 565, 868, 5, 46}); auto it = std::begin(a); std::cout << *it << std::endl; std::cout << *std::next(it) << std::endl; std::cout << *std::prev(it) << std::endl; std::cout << *std::next(it, 4) << std::endl; auto end = std::end(a); std::cout << *std::next(end, -4) << std::endl; std::cout << std::distance(it, end - 3) << std::endl; std::advance(it, 3); std::cout << *it << std::endl; return 0;
