std::vector is the most fundamental container in C++. It models a contiguous dynamic array. It has constant (\( O(1) \)) index-based random access to elements. Vectors offer random access insertion and erasure of elements as well as efficient pushing and popping of elements at the end of the vector. Indexing is 0-based which is the same for all index based containers. Insertion and erasure is less efficient anywhere in the vector that is not the back (\( O(n) \) where \( n \) is the number elements past the insertion or erasure) as all elements past the insertion or erasure have to be moved back one cell. Insertion and erasure also (has a chance of [invalidating]) invalidates any iterators or references of the shifted elements. Vectors can reserve more memory then it currently uses in order to make any operations involving potential allocations more efficient by pre-allocating the resources. Erasures also do not remove the memory owned by the vector but save it for later use. #include <iostream>
#include <vector> template<typename T>
auto println(const std::vector<T>& v) -> void
{ std::cout << "[ "; for (auto i { v.size() }; const auto& e : v) std::cout << e << (--i ? ", " : ""); std::cout << " ]" << std::endl;
} auto main() -> int
{ auto v = std::vector<int>{ 1, 2, 3, 4, 5 }; println(v); v.push_back(6); println(v); v.pop_back(); v.pop_back(); println(v); v.insert(v.begin() + 3, 77); println(v); v.erase(v.end() - 4); println(v); std::cout << "v[4] = " << v[4] << std::endl; ///< Unsafe version std::cout << "v.at(2) = " << v.at(2) << std::endl; ///< Range checked std::cout << "Before v.shrink_to_fit()" << std::endl; std::cout << "Size: " << v.size() << std::endl; std::cout << "Capacity: " << v.capacity() << std::endl; println(v); v.shrink_to_fit(); std::cout << "After v.shrink_to_fit()" << std::endl; std::cout << "Size: " << v.size() << std::endl; std::cout << "Capacity: " << v.capacity() << std::endl; println(v); v.clear(); std::cout << "After v.clear()" << std::endl; std::cout << "Size: " << v.size() << std::endl; std::cout << "Capacity: " << v.capacity() << std::endl; println(v); return 0;
} Exmaple std::vector

