A view is a simple abstraction on a range. Views can be thought of as a reference or pointer to a range that is cheap to copy, move, assign and destroy. Views allow for a ranges to be used in a lazy evaluation contexts. Views are found in the std::ranges namespace from the <range> header, often with a '_view' suffix or can be found in the std::views namespace of the same header without the suffix. Views can be passed to range based algorithms or even used as the range evaluated in a range-for. Ranges can be created from an iterator and sentinel pair or a range using std::subrange. #include <algorithm>
#include <iostream>
#include <ranges>
#include <vector> auto main() -> int
{ auto v = std::vector<int>{ 1, 2, 3, 4, 5 }; /// Note: This is unnecessary and is only a showcase for (const auto& e : std::ranges::subrange(v.begin(), v.end())) std::cout << e << " "; std::cout << std::endl; return 0;
} Example

