std::views::transform - a range adapter whose resulting view maps an unary function to the input range. std::views::filter - a range adaptor that whose resulting view excludes any element that do not satisfy an unary predicate. std::views::reverse - a range adaptor returning a view of the input range as if its order was reversed. std::views::take - a range adaptor whose resulting view take only \( n \) elements from the input range. Performs bound checks to ensure that it doesn't take more elements then the view can see. std::views::take_while - a range adaptor whose resulting view contains every element until an unary predicate returns false. std::views::drop - a range adapter whose resulting view skips the first \( n \) elements from a input range. std::views::drop_while - a range adaptor whose resulting view starts at the first element for which the unary predicate evaluates false. std::views::join - a range adaptor whose resulting view will flatten nested range or view object a single view. std::views::split - a range adaptor whose resulting view contains subranges split by a given deliminator. Is not entirely lazy and will eagerly move forward through the view at each iteration during evaluation. std::views::lazy_split - a range adaptor whose resulting view contains subranges split by a given deliminator Is entirely lazy evaluated but is unable to model the subranges as a common range (a range with the same type for the iterator and sentinel) and cannot be used in algorithms expecting a bidirectional range (or higher). std::views::common - a range adaptor whose resulting view adapts the input range to have the same type for its iterator and sentinels. std::views::element - a range adaptor that accepts an input range with Tuple-Like elements and whose resulting view contains the \( Nth \) entry from every Tuple-Like element of the input range. std::views::keys - a range adaptor who is a specialisations of std::views::elements taking the \( 0th \) entry of a view of Tuple-Like elements. This can be used to obtain a view of just the keys of an associative container. std::views::values - a range adaptor who is a specialisations of std::views::elements taking the \( 1st \) entry of a view of Tuple-Like elements. This can be used to obtain a view of just the values of an associative container. #include <algorithm>
#include <iostream>
#include <ranges> auto square = [](const auto& x){ return x * x; };
auto even = [](const auto& x){ return x % 2 == 0; }; auto main() -> int
{ auto nums = std::views::iota(0) | std::views::transform(square) | std::views::filter(even) | std::views::take(10); std::ranges::copy(nums, std::ostream_iterator<int>(std::cout, " ")); std::cout << std::endl; return 0;
} Example std::views::transform std::views::filter std::views::reverse std::views::take std::views::take_while std::views::drop std::views::drop_while std::views::join std::views::split std::views::lazy_split std::views::common std::views::elements std::views::keys std::views::values

