A mutex is a mutually-exclusive-object . It is used to synchronize access to shared memory resources across multiple threads. C++ mutex type is called std::mutex from the <mutex> header. Threads can own a std::mutex by locking it. Other threads will block when they try to lock a std::mutex owned by another thread. std::mutex also implement a try-lock that returns a Boolean indicating the result off the lock attempt. A thread cannot own a std::mutex before it tries to lock it. Mutexes are generally implemented as a OS primitive. Because std::mutex (and C++ other mutex types) use locking and unlocking methods to control access, these types are not considered to be RAII types. Instead there are locking types that will lock a mutex on construction and unlock it on destruction (more below). #include <chrono>
