{ std::this_thread::sleep_for(150ms); auto ss = std::stringstream{}; ss << std::this_thread::get_id(); auto thread_id = std::stoll(ss.str()); while (!mx.try_lock()) std::this_thread::sleep_for(150ms); map.insert({ job_id, thread_id }); mx.unlock(); std::this_thread::sleep_for(150ms);
}; auto main() -> int
