A promise; represented by the class std::promise, is a object that stores a value or exception that is retrieved by a std::future object. Semantically, this means that a; generally asynchronous function has promised a value to the caller of the asynchronous function but however, does not yet have the value. The future of a promised value is obtained directly from the std::promise object. The caller of the promised value can query, wait for or extract the value from the corresponding std::future object however, these may block if the result is not yet ready. The timeout methods will return a std::future_status object which is an enum indicating if the wait timed out, if the future is deferred ( lazy loading) or ready. The value of a promise is communicated via a shared memory state between the std::future and std::promise objects. This shared state cannot be shared between different threads meaning that only one std::future can be used to obtain the result of a promised value. To enforce this std::future is move-only. A shared future can be obtained by called std::future::share to create a std::shared_future which claims ownership of the shared state such that the future can be copied between different threads. Promises and futures are found in the <future> header. #include <chrono>
#include <future>
#include <iostream>
#include <thread>
