Another way to create asynchronous functions without having to deal with threads directly is to use std::async. This function will create an asynchronous section that will run according to a launch policy. The standard only defines two policies, this being std::launch::async; which will run a function a separate thread, or std::launch::deferred which will run the function lazily on the calling thread the first time the value is requested. std::async returns a std::future object that is used to query, wait for or extract the result of the asynchronous function. std::async is found in the <future> header. #include <algorithm>
#include <chrono>
#include <concepts>
#include <execution>
#include <future>
#include <iomanip>
#include <iostream>
#include <iterator>
#include <numeric>
#include <utility>
#include <vector> template <typename time_t = std::chrono::microseconds>
struct measure
{ template <typename F, typename... Args> static auto execution(F func, Args&&... args) -> std::pair<typename time_t::rep, std::invoke_result_t<F, Args...>> { auto start = std::chrono::system_clock::now(); auto result = std::invoke(func, std::forward<Args>(args)...); auto duration = std::chrono::duration_cast<time_t>(std::chrono::system_clock::now() - start); return std::pair<typename time_t::rep, std::invoke_result_t<F, Args...>>{ duration.count(), result }; }
}; template<std::random_access_iterator I, std::sentinel_for<I> S, std::movable A>
auto parallel_sum(I first, S last, A init) -> A
{ auto middle = first + ((last - first) / 2); /// Launch async sum on last half of the values auto future = std::async(std::launch::async, parallel_sum<I, S, A>, middle, last, A{}); /// Sum first half of the range locally. auto result = parallel_sum(first, middle, init); /// Obtain the future and sum with the result return result + future.get();
} auto main() -> int
