So enough about types and values. Lets write some code that does something. In C++ there are a lot, and I mean a lot of operators but we will only cover the arithmetic based one this week. The first ones we will look at are the basic arithmetic operators. These include your standard: + - Addition - - Subtraction * - Multiplication / - Division % - Modulo For the meanwhile we will only look at operations on integers and floating point types. For these types the operators do what you would expect. Try out the following operations. #include <iostream> auto main () -> int
{ auto a{10}; auto b{3}; std::cout << "a + b = " << a + b << std::endl; ///< a + b = 13 std::cout << "a - b = " << a - b << std::endl; ///< a - b = 7 std::cout << "a * b = " << a * b << std::endl; ///< a * b = 30 std::cout << "a / b = " << a / b << std::endl; ///< a / b = 3?? std::cout << "a % b = " << a % b << std::endl; ///< a % b = 1 return 0;
} Example Note: for those unaware, % returns the remained of the division of \( \frac{a}{b} \) But hold up, why does a / b return 3, should it not be 3.33...? This correct.. sorta. In C++ when two integers divide it performs integer division, thus throwing away any remainder after the maximum even divisions. This is the same as Pythons // operator. To perform floating point division, either the numerator or denominator needs to be of a floating point type. This is so the alternate one (if it is an integer type) can be promoted to a floating point type to perform the floating point division. #include <iostream> auto main () -> int
{ auto a{10}; auto b{3}; auto c{3.}; auto d{10.}; std::cout << "a / c = " << a / c << std::endl; ///< a / c = 3.33333 std::cout << "d / b = " << d / b << std::endl; ///< d / b = 3.33333 return 0;
} Example Note: The modulo operator does not work for floating point types as this illogical (can't return remainder of a floating point division as it is near impossible to regain the information). You can also use + and - to change/force the sign of a integer or floating point type. #include <iostream> auto main () -> int
{ auto e{-5.43}; auto f{0.71}; std::cout << "e + f = " << e + f << std::endl; ///< e + f = -4.72 std::cout << "-e + f = " << -e + f << std::endl; ///< -e + f = 6.14 std::cout << "e - -f = " << e - f << std::endl; ///< e - f = -6.14 std::cout << "e - -f = " << e - -f << std::endl; ///< e - -f = -4.72 return 0;
} Example There are also in-place operators ++ and --. These allow you to increment/decrement integer types in place. There are two variations, prefix and postfix. Prefix will increment/decrement the value and then provide a lvalue of the new value of the object to whatever is reading it (if any). Postfix will provide an lvalue to copy of the old value and then increment/decrement the value. #include <iostream> auto main () -> int
{ auto g{1}; auto h{5}; std::cout << "g++ = " << g++ << std::endl; ///< g++ = 1 std::cout << "g = " << g << std::endl; ///< g = 2 std::cout << "++g = " << ++g << std::endl; ///< ++g = 3 std::cout << "g = " << g << std::endl; ///< g = 3 std::cout << "h-- = " << h-- << std::endl; ///< h-- = 5 std::cout << "h = " << h << std::endl; ///< h = 4 std::cout << "--h = " << --h << std::endl; ///< --h = 3 std::cout << "h = " << h << std::endl; ///< h = 3 return 0;
} Example

