In programming, it is useful to be able to check a multitude of Boolean expression. This allows programs to have more complex conditional logic structures. ! - Logical Not && - Logical And || = Logical Or Logical And and Or have special short circuiting properties. This means that the outcome of a Boolean expressions can be evaluated early. For And, if one Boolean point is false, it doesn't matter what the second point evaluates to as the expression's condition has already failed, thus whole expression would false. Inversely for Or, if one Boolean point is true the whole expression is true Note: There is no logical Xor. This is because Xor cannot short circuited as the result depends on the result of both points. However, we have already seen the logical Xor, it is the !=. If the two points of != are either both true or both false, the inequality condition is not met and thus achieving the exclusivity properties of Xor. In C++ because bool can be implicitly converted to other integral types, it is best that logicalXor is used as: !(a) != !(b). #include <iomanip>
