Functions in C++ consist of a declaration and definition. A declaration is the functions signature which consists of the functions name, its points and its return type. The definition is a code block with at least on return expression. T f(A1 a1, A2 a2)
{ /* code */ return ...;
} T is the return type A1 is the type of argument one stored in parameter a1 A2 is the type of argument one stored in parameter a2 return ...; is the return expression Functions have to be invoked to be used. This involves using the invocation operator () on the functions name. You can pass literals and objects to functions. You can also initialise and assign variables from the return of a function. #include <iostream> int add(int x, int y)
{ return x + y; } auto main () -> int
{ auto a {4}; auto b {7}; auto c {-3}; int d = add(5, 7); std::cout << add(a, b) << std::endl; std::cout << add(a, c) << std::endl; std::cout << add(a, d) << std::endl; std::cout << add(b, c) << std::endl; std::cout << add(b, d) << std::endl; std::cout << add(c, d) << std::endl; return 0;
} Example Functions allow us to abstract any common pattern into reusable code. #include <iostream> int sum(int s, int f)
{ auto acc {0}; for (auto i {s}; i < f; ++i) acc += i; return acc;
} auto main () -> int
{ std::cout << sum(0, 5) << std::endl; std::cout << sum(-3, 8) << std::endl; std::cout << sum(-11, -5) << std::endl; std::cout << sum(4, 19) << std::endl; return 0;
} Example

